import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for navigation menu to load
    await page.waitForSelector('.nav-menu', { state: 'visible' });

    // Click on Profile navigation item using data attribute selector
    await page.click('.nav-item[data-view="profile"]');

    // Wait for profile view to become active
    await page.waitForSelector('#profile-view.active', { state: 'visible' });

    // Wait for user profile information to load
    await page.waitForSelector('.profile-header', { state: 'visible' });

    // Take screenshot after successful navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_view.png'));

    // Extract profile information for verification
    const profileData = await page.evaluate(() => {
      const username = document.querySelector('.profile-username')?.textContent;
      const handle = document.querySelector('.profile-handle')?.textContent;
      const bio = document.querySelector('.profile-bio')?.textContent;

      return {
        username: username?.trim(),
        handle: handle?.trim(),
        bio: bio?.trim()
      };
    });

    return {
      success: true,
      action: "Clicked on Profile navigation item and viewed current user's profile",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    // Take screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'step_error.png') });
    screenshots.push(path.join(screenshotsDir, 'step_error.png'));

    return {
      success: false,
      action: "Failed to click on Profile navigation item",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
